import React, { useState, useEffect } from 'react';

import aggregateEvents from '../helpers/dataAggregator';
import BarChart from './BarChart';

const DisplayData = (props) => {
    const [eventMap, setEventMap] = useState(new Map());

    useEffect(() => {
        const [eMap, eSet] = aggregateEvents(props.data);
        setEventMap(eMap);
        console.log(eMap);
    })

    const displayAggregations = () => {
        const [eMap, eSet] = aggregateEvents(props.data);
        var listItems = [];
        for (const key in eMap) {
            listItems.push(`${key}: ${eMap[key]} mins`)
        }

        listItems.sort((a, b) => {
            const aTime = parseInt(a.split(': ')[1]);
            const bTime = parseInt(b.split(': ')[1]);
            return aTime > bTime;
        });

        listItems = listItems.map((item, idx) => 
            <li key={idx}>{item}</li>
        );

        return (
            <div>
                <ul>{listItems}</ul>
                <BarChart data={eMap} title={'test'} />
            </div>
        );
    }

    return (
        <div>
            <h2>Data Aggregation</h2>
            {displayAggregations()}
            <BarChart data={eventMap} title={'test'}/>
        </div>
    );
}

export default DisplayData;
